course = Course.create(:identifier => "2009 - (C5) - FormaCAo dos Coordenadores do MOVA Osasco ", :description => "Estabelecimento de vínculo de trabalho e de estudo junto ao grupo de coordenadores(as) do Mova Osasco. Mapeamento das demandas da coordenaCAo (formaCAo e atuaCAo profissional). ConsolidaCAo do instrumental de acompanhamento dos núcleos. Reflexão sobre a prática pedagógica a partir dos saberes da Pedagogia da Autonomia. Reconhecimento e identificaCAo dos níveis de escrita. ElaboraCAo de estrategias pedagógicas para as escritas pre-silábicas, silábicas e alfabeticas. ConstruCAo de rotinas de sistematizaCAo das dinâmicas educacionais promovidas nas atividades pedagógicas com vistas a monitorar e avaliar o desenvolvimento do Mova Osasco.")
