course = Course.create(:identifier => "2009 - (R1) - FormaCAo com Professores dos 1o anos e 2o anos do Ensinsino Fundamental ", :description => "Reflexão sobre o ambiente e as atividades que contribuem para a alfabetizaCAo nas series iniciais do Ensino Fundamental de nove anos, na perspectiva da vivência de experiências que possibilitam a aproximaCAo com o conhecimento científico construído e acumulado historicamente e que respeite os direitos fundamentais das crianças. Análise dos princípios da participaCAo da criança como sujeito de direitos no processo de aprendizagem. Reflexão acerca de propostas metodológicas que reafirmam a relevante tarefa de ensinar, tendo como principal objetivo a não ruptura do processo de alfabetizaCAo nas series iniciais, considerando a reorganizaCAo dos tempos, espaços e atividades diversificadas.")
