course = Course.create(:identifier => "2009 - (R2) - FormaCAo com Conselheiros dos Conselhos de Gestão Compartilhada ", :description => "Reflexão com a comunidade escolar acerca dos objetivos e princípios da Democracia Participativa, bem como das possibilidades de participaCAo no âmbito educacional, valorizando a Gestão Democrática. Estudo das ações que contribuem para o exercício da participaCAo na Unidade Escolar. Estudo, junto aos(às) educadores(as), gestores(as), familiares e educandos(as), de temáticas referentes à família, Leitura do Mundo, concepCAo de infância e dos marcos legais que garantem o fortalecimento do Conselho de Gestão Compartilhada na Rede. Estudo do contexto histórico-político da participaCAo popular no Brasil, destacando questões da democracia participativa, sobretudo dos conselhos escolares. ")
